import { MenuProps, SECTION } from "../App";
import { HomeIcon } from "../icons/HomeIcon";
import { image } from "./image";
import "../styles/vertex.css";

export default function Vertex({ section, setSection }: MenuProps) {
  return (
    <>
      <div className="home" onClick={() => setSection(SECTION.NONE)}>
        {HomeIcon}
      </div>
      <div className="vertex-board">
        <img width="30%" src={image} />
      </div>
    </>
  );
}
